The first order phase transition properties of VO2(M)/C nanofiber was analysed by the change in enthalpy using DSC measurements and the curves obtained are shown in Supplementary Fig. S3. The phase transition temperature for the bulk VO2 is reported at around 68 °C38. The curve obtained for heating and cooling probes the phase transition behaviour, which is different than the normal phase transfer trend reported for VO2(M) pure phase. There are several possible factors like defects, doping, stress, stoichiometry and size effects, which can make an abrupt shift in this phase transition temperature39,40. The endothermic and exothermic transition temperature obtained for heating and cooling are 90.2 °C and 82.5 °C respectively. The phase transition temperature Tc=(Tc+Th)/2\documentclass[12pt]{minimal}
