Tafel polarization of VO2(M)/C was performed to further analyse the charge transfer kinetics at the interface of CE/electrolyte using a symmetric cell configuration. The polarization curve displays the logarithmic current density (log J) as a function of voltage (V). Theoretically, the polarization curve has three distinct potential regions. The first region is a lower potential zone (|V| ≤ 120 mV), which is called as the polarization zone and second region is middle zone or tafel zone with a sharp slope, which determines the catalytic activity of the electrode. The final region is a higher potential zone (|V| > 400 mV) designated as a diffusion zone, which evaluates the electrode ion diffusion. The parameters such as exchange current density (J0) and limiting diffusion current density (Jlim) can be elucidated from the polarization plot, which further validates the electrochemical performance of the electrode. In the Tafel plot, the tangent slop of cathodic or anodic branch with the equilibrium potential details the information about the exchange current density (J0) on the electrode. Figure 9b shows the Tafel polarization of Pt and VO2(M)/C CE nanofiber. The J0 value for Pt is higher than that of VO2(M)/C nanofiber, which evidence the appreciable catalytic activity of as synthesized nanofiber. Also, there was a correlation between J0 and Rct given by Equation(5),5J0=RTnFRct\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
				\usepackage{amsfonts}
				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$${J}_{0}=\frac{RT}{nF{R}_{ct}}$$\end{document}where R is a gas constant, T is temperature, n is the number of electrons involved in the reaction of I3− to I− and F is the Faraday’s constant. From the above relation, the higher J0 value implies the lower Rct contribution of the electrode. EIS measurement justifies the value of Rct for Pt and VO2(M)/C CE. The limiting diffusion current density (Jlim) depends on the diffusion coefficient of the redox couple in the electrolyte47. From Fig. 9b, the diffusion zone showed a slightly higher Jlim value for Pt than VO2(M)/C, showing its good diffusion property. These results implies that VO2(M)/C nanofiber catalytic performance was comparable to that of Pt.
